                                        <h3>Danny Kovatch CST</h3> <span>CSM CSPO CSD</span>
                                        <div style="height:96px;" class="editor-content">
                                            <p>As a seasoned expert in the IT industry and the first CST in Israel, Danko is a well-recognized international speaker with unique ways of presenting Scrum to newcomers. His first steps began in 1997 when he completed 5 years of service in the Israeli army in a special elite program, where he was Group Manager in a computer unit. Afterwards, Danko joined a startup by the name of EagleEye, a subsidiary company of New Dimension where he was in charge of several development groups.</p>
