                                <div style="height:96px;overflow:hidden;margin-bottom:11px;" class="editor-content">
                                    <p>Our world is so small but heavily filled with emotions, competitions, games, and politics. I believe in&nbsp;<strong>“United we stand, divided we fall”</strong>&nbsp;and&nbsp;<strong>“It’s easy to pull down but not easy to build up”.</strong>&nbsp;So collaboration and knowledge sharing are the key to success and to create an environment where people can have&nbsp;a win-win situation. Collaborative culture should be developed top to bottom in the organizations to enjoy the success and make it long lasting. I always work towards that direction and I also encourage and support the people whom I work the same way.</p>
                                    <p><strong>The core values</strong>&nbsp;that I follow in personal and professional life all the time are:&nbsp;<strong><em>Honesty, Transparency, Positive Thinking, Validated Learning, Share and Care, Receptive</em></strong>.</p>
                                    <p>I started my software career in 1998 as a software developer and worked on few ERP, e-Commerce, client-server, web projects and also mobile projects. I played various roles in my career that include: Tech Lead, Project Lead, Project Manager, Senior Delivery Manager, Scrum Master,&nbsp;Agile Coach, and Product Manager. I also have a strong technical background that helps me to contribute to the teams in technical guidance and engineering practices coaching</p>
                                    <p>I started my agile journey in 2009 and played product owner, Scrum Master and Developer roles in various projects/products I have worked with. I thoroughly understand the challenges in these roles. I was fortunate to be part of a large-scale agile transformation in a product based organization using LeSS framework. I have gained great experience as an Agile Coach during this transformation. I helped few organizations to transform into Agile.</p>
                                    <p>I am certified in&nbsp;<strong>CST,</strong>&nbsp;<strong>CAL1,</strong>&nbsp;<strong>CTC, CSPO, CSP-SM, CSP-PO, CSM, PMI-ACP, ITIL v3</strong>&nbsp;and&nbsp;<strong>PMP</strong>. Training and coaching is my passion and I contribute to the following training programs:</p>
                                    <ul>
