                                        <li>PMI-ACP (Certified Agile Practitioner)*</li>
                                        <li>Agile Estimation &amp; Release Planning</li>
                                        <li>Writing effective user stories</li>
                                        <li>Path&nbsp;to Agile Coach</li>
                                    </ul>
