                                    <p>For more than 25 years, Daniel has been teaching, mentoring, coaching, and consulting for organizations of many sizes; from startups to multi-national enterprises. Daniel has led large-scale Agile adoption initiatives for organizations in Financial Services, Education, Health Care, Bio-tech, Pharma, Information Technology Consulting, Professional Associations, and Federal Government.</p>
