                                                        <li>GE Healthcare</li>
                                                        <li>Siemens Healthineers</li>
                                                        <li>MediQuire</li>
                                                        <li>Evolent Health&nbsp;</li>
                                                    </ul>
                                                    <p><b>Financial:</b></p>
                                                    <ul>
                                                        <li>Societe Generale Global Solution Centre</li>
                                                        <li>Fidelity Investments</li>
                                                        <li>PayPal</li>
                                                        <li>Mastercard</li>
                                                        <li>Axis Bank<b>&nbsp;</b></li>
                                                    </ul>
                                                    <div>
                                                        <p><b>Manufacturing:</b><b>&nbsp;</b></p>
                                                        <ul>
                                                            <li>ASSA ABLOY Group</li>
                                                        </ul>
                                                        <p><b>Education:</b></p>
                                                        <ul>
                                                            <li>Blackboard Inc.</li>
                                                        </ul>
                                                    </div>
