                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-1-10">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-10" aria-expanded="false" aria-controls="seo-content-1-10">What is the difference between CSPO and PSPO?</a> </h4>
                                        </div>
                                        <div id="seo-content-1-10" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-10">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>CSPO or Certified Scrum Product Owner is a certification offered for the Product Owner by the Scrum Alliance. PSPO or Professional Scrum Product Owner is another certification offered for the Product Owner role by Scrum.org. Both certifications are equivalent in terms of high standards of quality. The difference lies in the way of obtaining and maintaining the certifications.</p>
                                                    <p>The CSPO certification exam is taken online after completing a mandatory 2-day training given by a Certified Scrum Trainer. For the PSPO certification, training is not a prerequisite to taking the online exam. Here are a few more differences between the two certifications that you should know:</p>
                                                    <table class="table table-bordered">
                                                        <tbody>
                                                            <tr>
                                                                <td>Criteria<br></td>
                                                                <td>CSPO<br></td>
                                                                <td>PSPO<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Accreditation Body<br></td>
                                                                <td>Scrum Alliance<br></td>
                                                                <td>Scrum.org<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Renewal<br></td>
                                                                <td>Valid for 2 year, after which a renewal fee of $100 would apply along with a requirement for 20 Scrum Educational Units to maintain the certificate.<br></td>
                                                                <td>The certificate does not expire.<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Price<br></td>
                                                                <td>$500 (cost can vary depending on your location)<br></td>
                                                                <td>$200 (attending the workshop can cost more)<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Need for training<br></td>
                                                                <td>A 2-day CSPO classroom training from a Certified Scrum Trainer is mandatory.<br></td>
                                                                <td>Training is not a prerequisite.<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Passing Score<br></td>
                                                                <td>You must complete activities for achieving the credentials at the trainer’s discretion.<br></td>
                                                                <td>85%<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Time Limit exam<br></td>
                                                                <td>None<br></td>
                                                                <td>60 Minutes<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Number of Questions exam<br></td>
                                                                <td>None<br></td>
                                                                <td>80<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Format exam&nbsp;<br></td>
                                                                <td>None<br></td>
                                                                <td>Multiple Choice, Multiple Answers and True/False<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Language exam&nbsp;<br></td>
                                                                <td>None<br></td>
                                                                <td>English<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Difficulty level<br></td>
                                                                <td>Intermediate (the next level after CSPO is A-CSPO)<br></td>
                                                                <td>Intermediate (After PSPO, there are subsequent complex levels as PSPO II and III)<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>After Exam Certification<br></td>
                                                                <td>Industry-recognized CSPO certification issued by Scrum Alliance, along with a CSPO logo.<br></td>
                                                                <td>Industry-recognized PSPO-I certification issued by Scrum Alliance, along with a PSPO-I logo.<br></td>
                                                            </tr>
                                                            <tr>
                                                                <td>Membership<br></td>
                                                                <td>2-Year membership with Scrum Alliance<br></td>
                                                                <td>Scrum.org membership that does not expire<br></td>
                                                            </tr>
                                                        </tbody>
                                                    </table>
                                                    <p><br>To assess the value of certification, you need to consider the following:</p>
                                                    <ul>
                                                        <li>Prior knowledge or competence</li>
                                                        <li>Difficulty of the assessment process</li>
                                                        <li>Validity of the certification</li>
                                                        <li>Cost involved</li>
                                                    </ul>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-1-11">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-11" aria-expanded="false" aria-controls="seo-content-1-11">What skills does a Product Owner need?</a> </h4>
                                        </div>
                                        <div id="seo-content-1-11" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-11">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>A Product Owner is a person who determines what a Scrum team delivers to stakeholders. Product Owners are a liaison between the development team and stakeholders such as end-users, marketing, sales, customer support, higher management, etc. They carry the vision and manage the user feedback. All Scrum Team needs a Product Owner, as without them, the team will not deliver what is most valuable to stakeholders. As a Product Owner, you must have the following skills:</p>
                                                    <ul>
                                                        <li><b>Communication skills</b> - A Product Owner works with many stakeholders to understand their vision and helps the development team to bring it to reality. Without good communication skills there will be less alignment amongst stakeholders and less fruitful interactions between stakeholders and the team.</li>
                                                        <li><b>Commitment</b> - As a Product Owner, you should be committed to the vision, business goals and the team.</li>
                                                        <li><b>Power of No</b> - A Product Owner is responsible for managing the requests and feedback from stakeholders. Many times, they have to say ‘No’. Developers cannot develop every idea or feedback the stakeholders have, because there are always limits on time and budget. That is why it is important to say ‘No’ in a manner that does not upset or discourage the business.</li>
                                                        <li><b>Vision</b> - Product Owners are responsible for seeing and communicating the product’s full vision and steering the ship forward. They also align the vision of the product with the vision and needs of the company. Furthermore, a Product Owner needs to communicate the relation between the business goals and the backlog items.</li>
                                                        <li><b>Curiosity</b> - As a Product Owner, you must be curious to ask ‘Why’ from business and ‘how’ from the development team. And bring stakeholders together with the development team to stimulate unexpected solutions to occur.</li>
                                                    </ul>
                                                    <p>All the above-mentioned skills are linked together with communication. A Product Owner must be a master communicator and ensure that stakeholders and Scrum Team are aligned together for making the vision come true.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-1-12">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-12" aria-expanded="false" aria-controls="seo-content-1-12">For a business analyst which is the best product owner certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-1-12" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-12">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Here are some of the best Product Owner Certification for a business analyst:</p>
                                                    <ul>
                                                        <li><b>Certified Scrum Product Owner (CSPO) -</b> This certification will help you expand the horizons of your career. You will be able to demonstrate your Scrum knowledge, engage with agile practitioners, and understand all the Scrum methodologies.</li>
                                                        <li><b>SAFe Product Owner/Product Manager (SAFe POPM) -</b> As a Scaled Agile Product Owner, you are responsible for the Lean-Agile team. If your organization has adopted scaled agile methodologies, then you should go for this certification. It will help you develop skills to lead any agile team towards growth. You will learn about the value and quality control of the product. The certification facilitates the gamut of information on release training, planning, and execution of Agile projects in a Lean-Agile environment.</li>
                                                        <li><b>Professional Scrum Product Owner l, II, III (PSPO I, II, III) -</b> This certification can be considered as a self-paced learning method that provides all the information on how to manage a project effectively. It is best suited for Agile and Scrum enterprise. Its focus is on how to maximize the product’s value. Completing the three levels of qualification will make you an expert in product ownership.</li>
                                                    </ul>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-1-13">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-13" aria-expanded="false" aria-controls="seo-content-1-13">What is a CSPO?</a> </h4>
                                        </div>
                                        <div id="seo-content-1-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-13">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Certified Scrum Product Owner or CSPO is a Scrum certification offered by the Scrum Alliance. Anyone who wants to be a Product Owner in a Scrum team should go for this certification. It is a globally recognized certification that you can use in different industries like information technology, infrastructure, automobile, etc. The CSPO course will cover the following:</p>
                                                    <ul>
                                                        <li>Fundamentals of Scrum and Agile</li>
                                                        <li>Product Discovery</li>
                                                        <li>Product Roadmap</li>
                                                        <li>Product Vision</li>
                                                        <li>Estimation</li>
                                                        <li>Use stories</li>
                                                        <li>Burn up and burn down charts</li>
                                                        <li>Release planning, etc.</li>
                                                    </ul>
                                                    <p>The primary aim of this certification is to help the candidates understand what the role of a Product Owner is. A good way to do this would be understand the responsibilities, characteristics, and common anti-patterns of a Product Owner.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="cert-and-exam-section" id="certification-process-cspo-training">
                                <h3>CSPO® Training</h3>
                                <div class="panel-group accordion seo-content-accordion-2" role="tablist" aria-multiselectable="true">
                                    <div class="panel panel-default">
                                        <div class="panel-heading active" role="tab" id="seo-content-heading-2-1">
                                            <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-1" aria-expanded="false" aria-controls="seo-content-2-1">What is the importance of the CSPO course?</a> </h4>
                                        </div>
                                        <div id="seo-content-2-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-2-1">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>It is the Product owner’s responsibility to ensure that an Agile project goes as planned, customer requirements are met and the end product is delivered on time, within budget and is of the highest quality. While practical learning of these skills is essential, a CSPO certificate will ensure your commitment to the profession and teach you the tools and techniques needed to ensure project success. A CSPO certification paves the way for better and bigger opportunities in the field of Agile. Our CSPO course will teach you how to gain the all-important practical skills required by a Product Owner, making you successful in your projects.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-2-2">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-2" aria-expanded="false" aria-controls="seo-content-2-2">Is Certified Scrum Product Owner® training right for me?</a> </h4>
                                        </div>
                                        <div id="seo-content-2-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-2">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Yes, of course. The CSPO&nbsp; training is right for you if you fall under any of the following categories:</p>
                                                    <ul>
                                                        <li>If you want to learn how to prioritize and interface with Agile teams</li>
                                                        <li>If you want to maximize the benefits of Agile projects</li>
                                                        <li>If you are a Product Owner or Product Manager and are looking to advance your skills while addressing real-world issues that you have encountered</li>
                                                    </ul>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-2-3">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-3" aria-expanded="false" aria-controls="seo-content-2-3">Does Scrum Alliance offer an online/virtual training for CSPO course?</a> </h4>
                                        </div>
                                        <div id="seo-content-2-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-3">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Yes, there is an online/virtual course for CSPO.&nbsp;</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-2-4">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-4" aria-expanded="false" aria-controls="seo-content-2-4">Who are the instructors for CSPO training?</a> </h4>
                                        </div>
                                        <div id="seo-content-2-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-4">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Our Certified Scrum Trainers® (CSTs) are:</p>
                                                    <ul>
                                                        <li>Professionals licensed by Scrum Alliance to teach the official Scrum Alliance curriculum,</li>
                                                        <li>Masters in Scrum who have immense experience in leading, applying, coaching, and teaching it,</li>
                                                        <li>Skilled in product management and software development, and</li>
                                                        <li>Subject experts who are active in software development and local Agile communities, along with the broader global Scrum and Agile movements.</li>
                                                    </ul>
                                                    <p>Our dedicated team of CSTs delivers training on par with the standard of excellence as set out by Scrum Alliance. So, every candidate receives the same high-quality content irrespective of the trainer and the location. They help you further develop the competencies and skills you need to make a difference in your organization.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="cert-and-exam-section" id="certification-process-cspo-certification">
                                <h3>CSPO® Certification</h3>
                                <div class="panel-group accordion seo-content-accordion-3" role="tablist" aria-multiselectable="true">
                                    <div class="panel panel-default">
                                        <div class="panel-heading active" role="tab" id="seo-content-heading-3-1">
                                            <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-1" aria-expanded="false" aria-controls="seo-content-3-1">Who offers the CSPO certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-3-1">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>The Certified Scrum Product Owner®(CSPO) designation is provided by Scrum Alliance. The Scrum Alliance Product Owner certification enhances your industry credibility and recognition. It also amplifies your earning potential as it validates your commitment to your Agile journey, making you eligible to take on the responsibilities of an Agile Product Owner and lead projects successfully.&nbsp;</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-2">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-2" aria-expanded="false" aria-controls="seo-content-3-2">Is the Certified Scrum Product Owner® a valued certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-2">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>Certified Scrum Product Owner® is a much sought-after credential in the Agile space, and the<a href="#value-of-a-certified-scrum-product-owner" target="_blank"> value of the CSPO certification</a> has gained momentum since the last few years. In today’s constantly changing industry environment, businesses have realized the value of adopting an Agile methodology to achieve higher profitability with better utilization of resources. By recruiting experts who are proficient in agile methods, they can ensure that teams are better tuned-in to the Agile mindset, thus ensuring project success. CSPO certified professionals have the knowledge and skills to enable them to make the right decisions as an effective customer to the Scrum team, motivating their team members to perform better and maximizing ROI which is the need of the hour.&nbsp;</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-3">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-3" aria-expanded="false" aria-controls="seo-content-3-3">What are the career benefits you carry along with the CSPO certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-3">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <ul>
                                                        <li>Gain an exemplary foundation of Scrum</li>
                                                        <li>Enhance the level of Scrum functionalities</li>
                                                        <li>Provide leadership to Agile teams</li>
                                                        <li>Improve professional skills, as an efficient Product Owner</li>
                                                        <li>Integrate the newly acquired skills to improve employment prospects&nbsp;</li>
                                                        <li>Stay updated by gaining an updated understanding of different Agile practices</li>
                                                        <li>Expand your career opportunities across all industries adopting Agile practices</li>
                                                        <li>Gain access to a number of local groups of Scrum users and social networks.</li>
                                                    </ul>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-4">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-4" aria-expanded="false" aria-controls="seo-content-3-4">How can I get the CSPO certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-4">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>CSPO is a participation-based certificate. On successful completion of an in-person, two day (16 hours) CSPO course taught by a Certified Scrum Trainer® (such as this course), you will receive a Certificate from Scrum Alliance designating you as Certified Scrum Product Owner®. The certification includes a two-year membership in Scrum Alliance.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-5">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-5" aria-expanded="false" aria-controls="seo-content-3-5">How much do I need to pay to obtain the CSPO certification?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-5">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>The course fee paid includes the first 2 years of Certified Scrum Product Owner® certification cost.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-6">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-6" aria-expanded="false" aria-controls="seo-content-3-6">Does my CSPO certificate require renewal?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-6">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>CSPO certification renewal needs to be done every 2 years. You need to pay $100 to extend the credential for a further 2 years from the date of your current expiration. In order to renew your Scrum Product Owner certification, log in to <a href="#" target="_blank" rel="nofollow">https://www.scrumalliance.org/login, </a>go to your dashboard and choose the ‘Renew Certification’ option available under the heading ‘Actions’.</p>
                                                    <p><br></p>
                                                    <p>Starting from February 4, 2019, candidates are now required to earn 20 Scrum Educational Units (SEUs) within the past two years, in addition to the $100 renewal fee that has to be paid.This new requirement has been mandated to validate your participation and continued proficiency in the fundamental principles and practices of Scrum. You can earn the required SEUs by completing an educational training or a learning opportunity.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-3-7">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-7" aria-expanded="false" aria-controls="seo-content-3-7">What is the average Certified Scrum Product Owner® salary?</a> </h4>
                                        </div>
                                        <div id="seo-content-3-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-7">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>At present, the <a href="#" target="_blank">average Certified Product Owner salary</a> is<b> $100K</b> per year.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="cert-and-exam-section" id="certification-process-cspo-certification-exam">
                                <h3>CSPO® Certification Exam</h3>
                                <div class="panel-group accordion seo-content-accordion-4" role="tablist" aria-multiselectable="true">
                                    <div class="panel panel-default">
                                        <div class="panel-heading active" role="tab" id="seo-content-heading-4-1">
                                            <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-1" aria-expanded="false" aria-controls="seo-content-4-1">What is the format of the Scrum Product Owner Exam?</a> </h4>
                                        </div>
                                        <div id="seo-content-4-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-4-1">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>There is no Scrum Alliance Product Owner certification exam to earn a CSPO credential.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="cert-and-exam-section" id="certification-process-pdus-seus">
                                <h3>PDUs &amp; SEUs</h3>
                                <div class="panel-group accordion seo-content-accordion-5" role="tablist" aria-multiselectable="true">
                                    <div class="panel panel-default">
                                        <div class="panel-heading active" role="tab" id="seo-content-heading-5-1">
                                            <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-1" aria-expanded="false" aria-controls="seo-content-5-1">What do you mean by PDUs and SEUs?</a> </h4>
                                        </div>
                                        <div id="seo-content-5-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-5-1">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>PDUs are Professional Development Units issued by the Project Management Institute, and SEUs are Scrum Educational Units issued by the <a href="https://www.scrumalliance.org" target="_blank" rel="nofollow">Scrum Alliance. </a>They can be earned by completing educational training or learning opportunities, which serve to validate your participation and continued proficiency in the principles and practices of project Management and Scrum, respectively.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-5-2">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-2" aria-expanded="false" aria-controls="seo-content-5-2">Where are PDUs and SEUs applicable?</a> </h4>
                                        </div>
                                        <div id="seo-content-5-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-2">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>PDUs and SEUs are credits awarded by the<a href="#"> Project Management Institute</a> and the <a href="#" target="_blank" rel="nofollow">Scrum Alliance</a> respectively. They recognize your dedication to the Agile world through the award of credits for every educational effort you make throughout your career. Scrum Alliance members who hold a credential from Scrum Alliance need to earn SEUs to get recertified every two years. PDUs are offered by the PMI®, and every PMI® certification, except the CAPM®, requires you to earn a specific number of PDUs per three-year certification cycle.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="panel panel-default">
                                        <div class="panel-heading" role="tab" id="seo-content-heading-5-3">
                                            <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-3" aria-expanded="false" aria-controls="seo-content-5-3">How many PDUs will I be eligible for?</a> </h4>
                                        </div>
                                        <div id="seo-content-5-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-3">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <p>You can get 14-16 PDUs and SEUs by participating in our 2-day training program.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="cert-and-exam-section" id="certification-process-must-read-blogs">
                                <h3>Must-read blogs</h3>
                                <div class="panel-group accordion seo-content-accordion-6" role="tablist" aria-multiselectable="true">
                                    <div class="panel panel-default">
                                        <div class="panel-heading active" role="tab" id="seo-content-heading-6-1">
                                            <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-1" aria-expanded="false" aria-controls="seo-content-6-1">Here are some of the blogs you should read to get an understanding of the role of a Scrum Product Owner (SPO)</a> </h4>
                                        </div>
                                        <div id="seo-content-6-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-6-1">
                                            <div class="panel-body">
                                                <div class="editor-content">
                                                    <ul>
                                                        <li><a href="#4-tips-to-become-a-better-scrum-product-owner" target="_blank">4 tips to become a better SPO</a></li>
                                                        <li><a href="#6-skills-you-need-to-be-a-great-product-owner" target="_blank">6 skills you need to be a great SPO</a></li>
                                                        <li><a href="#scrum-master-and-product-owner-understanding-the-differences" target="_blank">Understanding the differences between Product Owner and Scrum Master</a></li>
                                                    </ul>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
