                    }, {
                        "@type": "Question",
                        "name": "Do you provide any discount for CSPO certification training programs?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>We offer a variety of discounts with the dates and time that fits your requirements. The larger the group, the larger the overall discount. Our discounts vary depending on various factors such as size of the group, training location, etc.</p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "I would like to know more about the training program. Whom should I contact?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>You can join our Live Chat for instant support or send an e-mail to <a href=\"http://support@knowledgehut.com\" target=\"_blank\">support@knowledgehut.com</a>, and we will answer any queries you may have!</p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "Career growth in store for a Certified Scrum Product Owner®",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<ul><li>Business Analyst</li><li>Project Manager</li><li>Product Manager</li><li>Chief Executive Officer (CEO)</li></ul><p>For a detailed overview of the CSPO career path,<a href=\"#career-path-of-a-scrum-product-owner\" target=\"_blank\"> click here.&nbsp;</a></p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "What next after CSPO?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>Your next step in your Agile journey after earning your foundational CSPO certification and a year of experience working as a CSPO on a Scrum Team is to achieve your <a href=\"https://www.knowledgehut.com/agile-management/advanced-certified-scrum-product-owner-training\" target=\"_blank\">Advanced Certified Scrum Product Owner™ (A-CSPO™) certification.</a></p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "What are the career benefits you carry along with the CSPO certification?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<ul><li>Gain an exemplary foundation of Scrum</li><li>Enhance the level of Scrum functionalities</li><li>Provide leadership to Agile teams</li><li>Improve professional skills, as an efficient Product Owner</li><li>Integrate the newly acquired skills to improve employment prospects&nbsp;</li><li>Stay updated by gaining an updated understanding of different Agile practices</li><li>Expand your career opportunities across all industries adopting Agile practices</li><li>Gain access to a number of local groups of Scrum users and social networks.</li></ul>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "How can I get the CSPO certification?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>CSPO is a participation-based certificate. On successful completion of an in-person, two day (16 hours) CSPO course taught by a Certified Scrum Trainer® (such as this course), you will receive a Certificate from Scrum Alliance designating you as Certified Scrum Product Owner®. The certification includes a two-year membership in Scrum Alliance.</p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "How much do I need to pay to obtain the CSPO certification?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>The course fee paid includes the first 2 years of Certified Scrum Product Owner® certification cost.</p>"
                        }
                    }, {
                        "@type": "Question",
                        "name": "What is the average Certified Scrum Product Owner® salary?",
                        "acceptedAnswer": {
                            "@type": "Answer",
                            "text": "<p>At present, the <a href=\"#"
                            target = \"_blank\">average Certified Product Owner salary</a> is<b> $100K</b> per year.</p>"
                        }
                    }]
